INSERT INTO `project` (`id`, `name`, `textEN`, `textFR`, `descriptionEN`, `descriptionFR`, `pubdate`, `view`, `category`, `icon`, `img`) VALUES
(1, 'Connect 4', 'Is a game in which the players choose a color and then take turns dropping colored tokens into a six-row, seven-column vertically suspended grid. The pieces fall straight down, occupying the lowest available space within the column. The objective of the game is to be the first to form a horizontal, vertical, or diagonal line of four of one\'s own tokens. It is therefore a type of M,n,k-game (7, 6, 4) with restricted piece placement. Connect Four is a solved game. The first player can always win by playing the right moves.', 'Est un jeu dans lequel les joueurs choisissent une couleur, puis déposent à tour de rôle des jetons colorés dans une grille suspendue verticalement à six rangées et sept colonnes. Les pièces tombent tout droit, occupant l\'espace disponible le plus bas dans la colonne. L\'objectif du jeu est d\'être le premier à former une ligne horizontale, verticale ou diagonale de quatre de ses propres jetons. Il s\'agit donc d\'un type de jeu M,n,k (7, 6, 4) avec placement restreint des pièces. Connect Four est un jeu résolu. Le premier joueur peut toujours gagner en jouant les bons coups.', 'Is a two-player strategy game in which the objective is to connect four of your pieces in a line, horizontally, vertically or diagonally, before your opponent does it. The game was implemented using the MIPS assembly language and runs on a MIPS processor. The game board is a 7x6 grid, and each player has a set of colored discs. To play the game, the players take turns depositing their discs in the columns of the board. The discs fall to the bottom of the column, occupying the lowest empty space in this column. The game ends when a player connects four discs in a row or the board is completely filled without any of the players getting a four in a row. The implementation of the game involves input and output operations, such as obtaining the user\'s input for his move, displaying the game board after each move and displaying the winner at the end of the game. The program also includes logic to check if a player has obtained a four in a row and to determine when the game is over. Overall, \"Connect 4\" is a simple but challenging game that tests the strategic thinking and decision-making skills of the players. The use of the MIPS assembly language adds an extra layer of complexity to the implementation, which makes it a good exercise to learn low-level programming.', 'Est un jeu de stratégie à deux joueurs dans lequel l\'objectif est de relier quatre de vos pièces en ligne, horizontalement, verticalement ou en diagonale, avant que votre adversaire ne le fasse. Le jeu a été implémenté en utilisant le langage d\'assemblage MIPS et fonctionne sur un processeur MIPS. Le plateau de jeu est une grille de 7x6, et chaque joueur a un ensemble de disques colorés. Pour jouer au jeu, les joueurs déposent à tour de rôle leurs disques dans les colonnes du plateau. Les disques tombent au bas de la colonne, occupant l\'espace vide le plus bas de cette colonne. Le jeu se termine lorsqu\'un joueur connecte quatre disques en ligne ou que le plateau est complètement rempli sans qu\'aucun des joueurs n\'obtienne un quatre d\'affilée. L\'implémentation du jeu implique des opérations d\'entrée et de sortie, telles que l\'obtention de l\'entrée de l\'utilisateur pour son coup, l\'affichage du plateau de jeu après chaque coup et l\'affichage du gagnant à la fin du jeu. Le programme comprend également une logique pour vérifier si un joueur a obtenu un quatre d\'affilée et pour déterminer quand la partie est terminée. Dans l\'ensemble, \"Connect 4\" est un jeu simple mais stimulant qui teste la réflexion stratégique et les compétences décisionnelles des joueurs. L\'utilisation du langage d\'assemblage MIPS ajoute une couche supplémentaire de complexité à l\'implémentation, ce qui en fait un bon exercice pour apprendre la programmation de bas niveau.', '2023-07-15', 10, 'mips', , );
INSERT INTO `project` (`id`, `name`, `textEN`, `textFR`, `descriptionEN`, `descriptionFR`, `pubdate`, `view`, `category`, `icon`, `img`) VALUES
(2, 'Gyromite', 'Is a video game that was released on the NES in 1985. It is the first of two video games that take advantage of Nintendo\'s R.O.B. accessory, the other one being Stack-Up (also for the NES).', 'Est un jeu vidéo sorti sur NES en 1985. C\'est le premier des deux jeux vidéo qui tirent parti de l\'accessoire R. O. B. de Nintendo, l\'autre étant Empilable (également pour la NES).', 'You play as Professor Hector, a slightly elderly scientist, who must cross his vast laboratory in order to collect and defuse the dynamite that is scattered in his laboratory. You have about eight minutes to use ROB to move \"gyroscopes\" in the real world so that the A or B button on the second controller is pressed, causing the blue and red pillars of the game to move up or down. You can\'t jump, but you can climb the vines, use moving pillars to go up or down, or fall off platforms to move around the level. You should also avoid the many Smicks that walk around the stage, which will bite the player when touched. Smicks can be distracted by using turnips, which can be found and picked up in some levels. When distracted, the Smicks stop moving and can no longer temporarily harm you. Pressing select will allow you to direct R. O. B., but you will have to stop moving, which may eventually leave the player in a vulnerable state. There is also a two-player mode, where players will periodically switch controllers, with player two controlling Professor Vector during their turn. In addition to the two-player mode, there is also an endless game mode B in which you have to control R. O. B. to move the pillars so that the sleepwalker Professor Hector does not get stuck or hurt.', 'Vous incarnez le professeur Hector, un scientifique un peu âgé, qui doit traverser son vaste laboratoire afin de collecter et de désamorcer la dynamite qui est dispersée dans son laboratoire. Vous disposez d\'environ huit minutes pour utiliser ROB pour déplacer des \"gyroscopes\" dans le monde réel de sorte que le bouton A ou B du deuxième contrôleur soit enfoncé, ce qui fait que les piliers bleu et rouge du jeu se déplacent vers le haut ou vers le bas. Vous ne pouvez pas sauter, mais vous pouvez grimper dans les vignes, utiliser des piliers mobiles pour monter ou descendre, ou tomber des plates-formes pour vous déplacer dans le niveau. Vous devez également éviter les nombreux Smicks qui se promènent autour de la scène, qui mordront le joueur au toucher. Les Smicks peuvent être distraits en utilisant des navets, qui peuvent être trouvés et ramassés dans certains niveaux. Lorsqu\'ils sont distraits, les Smicks cessent de bouger et ne peuvent plus vous nuire temporairement. Appuyer sur select vous permettra de diriger R. O. B., mais vous devrez arrêter de bouger, ce qui peut éventuellement laisser le joueur dans un état vulnérable. Il existe également un mode à deux joueurs, où les joueurs changeront périodiquement de manette, le joueur deux contrôlant le professeur Vector pendant leur tour. En plus du mode à deux joueurs, il existe également un mode B de jeu sans fin dans lequel vous devez contrôler R. O. B. pour déplacer les piliers afin que le somnambule Professeur Hector ne soit pas coincé ou blessé.', '2020-10-07', 11, 'java', , );
INSERT INTO `project` (`id`, `name`, `textEN`, `textFR`, `descriptionEN`, `descriptionFR`, `pubdate`, `view`, `category`, `icon`, `img`) VALUES
(3, 'Pizzeria Website', 'Includes elements such as a page title, meta tags for search engine optimization, and links to external style sheets. It is intended to organize and display various sections of a pizzeria website, including pizza choices, snacks, drinks and shopping cart.', 'Inclut des éléments tels qu\'un titre de page, des balises meta pour l\'optimisation des moteurs de recherche et des liens vers des feuilles de style externes. Il est destiné à organiser et à afficher diverses sections du site Web d\'une pizzeria, y compris les choix de pizzas, les collations, les boissons et le panier d\'achat.', 'This website presents the page title, the search and rescue optimization meta, as well as collateral features and external styles. The content of the HTML code consists of different sections, with a logo and navigation links, a section for the pizza selection, a section for the house overlay, a section for the drinks display browser and a section for the shopping cart. Basically, this code is used to structure and add content to a pizzeria\'s website.', 'Ce site Web présente le titre de la page, la méta d\'optimisation de la recherche et du sauvetage, ainsi que des fonctionnalités collatérales et des styles externes. Le contenu du code HTML se compose de différentes sections, avec un logo et des liens de navigation, une section pour la sélection de pizza, une section pour la superposition de la maison, une section pour le navigateur affichage des boissons et unesection pour le panier d\'achat. Fondamentalement, ce code est utilisé pour structurer et ajouter du contenu au site Web d\'une pizzeria.', '2021-06-09', 7, 'web', , );
INSERT INTO `project` (`id`, `name`, `textEN`, `textFR`, `descriptionEN`, `descriptionFR`, `pubdate`, `view`, `category`, `icon`, `img`) VALUES
(4, 'Sokoban', 'Is a classic puzzle game where the player must push boxes onto designated spots in a warehouse maze. The C programming language with SDL2 libraries was used to create one such version of the game.', 'Est un jeu de puzzle classique où le joueur doit pousser des boîtes sur des endroits désignés dans un labyrinthe d\'entrepôt. Le langage de programmation C avec les bibliothèques SDL2 a été utilisé pour créer une telle version du jeu.', 'The game is played on a board of squares, where each square is a floor or a wall. Some floor squares contain boxes, and some floor squares are marked as storage locations. The player is confined to the board and can move horizontally or vertically on empty squares (never through walls or boxes). The player can move a box by walking up to it and pushing it to the square beyond. The boxes cannot be pulled and they cannot be pushed to squares with walls or other boxes. The number of boxes is equal to the number of storage locations. The puzzle is solved when all the boxes are placed in storage slots.', 'Le jeu se joue sur un plateau de cases, où chaque case est un sol ou un mur. Certains carrés de sol contiennent des boîtes et certains carrés de sol sont marqués comme emplacements de stockage. Le joueur est confiné au plateau et peut se déplacer horizontalement ou verticalement sur des cases vides (jamais à travers des murs ou des boîtes). Le joueur peut déplacer une boîte en marchant jusqu\'à elle et en la poussant vers la case au-delà. Les boîtes ne peuvent pas être tirées et elles ne peuvent pas être poussées vers des carrés avec des murs ou d\'autres boîtes. Le nombre de boîtes est égal au nombre d\'emplacements de stockage. Le casse-tête est résolu lorsque toutes les boîtes sont placées dans des emplacements de stockage.', '2022-04-25', 7, 'c', , );

